import { Injectable } from '@angular/core';
import { ComplicationGlucidique } from '../models/ComplicationGlucidique';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class GlucidiqueService {

  private apiUrl = 'https://localhost:7129/api/ComplicationGlucidiques';

  constructor(private http: HttpClient) { }
  addGlucidique(ComplicationGlucidique: ComplicationGlucidique): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationGlucidique);

    return this.http.post<any>(`${this.apiUrl}/addGlucidique`, ComplicationGlucidique, { observe: 'response' });
  }

  getComplicationglucidiqueById(id: number): Observable<ComplicationGlucidique> {
    return this.http.get<any>(`${this.apiUrl}/${id}`);
  }

  update(id: number, complicationCoeur: ComplicationGlucidique): Observable<any> {
    return this.http.put(`${this.apiUrl}/update/${id}`, complicationCoeur, { observe: 'response' });
}
}
